function autoGet() {
    $("#theTree").html("");
    renderFoTree("theTree");
    renderFiData("theTree");
    $("#loadFiBtn").hide();
    $("#loadFoBtn").hide();   
}


//初始化树
function onInitTheTree(treeId) {
    $("#" + treeId).mTree({
        idField: "fiTag",
        foIdField: "foTag",
        text1Field: "text",
        text2Field: "textsub",
        checkbox: true,
        checked: true,     //是否选中
        treeDataType: "fc",
        showHide: true,
        expandFo: true,  //是否展开树
        expandFi:false,
        singleSelect: true,
        onFiClick: function (checkflag, value) {
            $("#showText").html("子结点 单击 事件,id:" + value + ",选中状态：" + checkflag);
        },
        onFiDblClick: function (checkflag, value) {
            $("#showText").html("子结点 双击 击事件,id:" + value + ",选中状态：" + checkflag);
        },
        onFoCheck: function (checkflag, value) {
            $("#showText").html("组织 选取 事件,id：" + value + ",选中状态：" + checkflag + "<br/>");
        },
        onFiCheck: function (checkflag, value) {
            $("#showText").html("子结点 选取 事件,id：" + value + ",选中状态：" + checkflag + "<br/>");
        },
        onFiContextMenu: function (e, checkflag, value) {
            e.preventDefault();
            $("#showText").html("子结点 右击 事件,id：" + value + ",选中状态：" + checkflag + "<br/>");
        },
        onFiMidClick: function (e, checkflag, value) {
            e.preventDefault();
            $("#showText").html("子结点 中轮点击 事件,id：" + value + ",选中状态：" + checkflag + "<br/>");
        }

    });
}

//加载组织树。
function loadFoData() {
    renderFoTree("theTree");
    $("#loadFoBtn").hide();
}


function renderFoTree(treeid) {
    var data = eval("(" + treeJson + ")");
     $("#" + treeid).html("");
     $("#"+treeid).mTree("loadFoData", data)
}


//加载各组织的子结点数据
function loadFiData() {
    renderFiData("theTree");
    $("#loadFiBtn").hide();
    $("#autoBtn").hide();   
}

function renderFiData(treeid) {
    var theMikeData = $("#" + treeid).mTree("getFoIds");  //获取组织id。
    var theNum = $("#theNum").val();
    if (theNum == "") theNum = 10;
    theNum = parseInt(theNum);
    for (var i = 1; i <= theMikeData.length; i++) {   //在循环中加载各个组织的子结点数据。
        var data = [];
        for (var j = 0; j < theNum; j++) {
            data.push({
                fiTag: i*10+j+"tttttth",
                foTag: i,
                text: "子节点" + i + "," + j,
                textsub: "隐含字段" + i + "," + j,
                OnLine: "True"
            });
        }
        $("#"+treeid).mTree("loadFiData", i, data);
    }
}

//=====================================================
function getSelected() {
    var dom = $("#theTree").mTree("getSelectedFi");
    var htmls = "";
    $(dom).each(function () {
        htmls += ("当前单击选中的车辆，唯一标识id:  " + this.id + ",   显示名称: " + this.text + ",  隐藏字段: " + this.hideText + "<br/>");
    })
    $("#showText").html(htmls)
}

function getCheckedCar() {
    var dom = $("#theTree").mTree("getCheckedFi");
    var htmls = "";
    $(dom).each(function () {
        htmls += ("当前复选选中的车辆，唯一标识id:  " + this.id + ",   显示名称: " + this.text + ",  隐藏字段: " + this.hideText + "<br/>");
    })
    $("#showText").html(htmls)
}


function updateCar() {
    var dom = $("#theTree").mTree("getSelectedFi");
    $(dom).each(function () {
        $("#theTree").mTree("updateFi", this.id, "icon-status", "更改的子节点名称" + this.id + "<br/>");
    })
}


function query() {
    var text = $("#theFiText").val();
    var dom = $("#theTree").mTree("fuzzyQuery", text, true);
    var htmls = "";
    $(dom).each(function () {
        htmls += ("当前匹配的车辆，唯一标识id:  " + this.id + ",   显示名称: " + this.text + ",  隐藏字段: " + this.hideText + "<br/>");
        $("#theTree").mTree("foldFo", this.id);
    })
    $("#showText").html(htmls)
}

function checkAll() {
    $("#theTree").mTree("checkAll");
}


function uncheckAll() {
    $("#theTree").mTree("uncheckAll");
}

function uncheckSelect() {
    var dom = $("#theTree").mTree("getSelectedFi");
    $(dom).each(function () {
        $("#theTree").mTree("unCheckFi", this.id);
    })
}

function checkSelect() {
    var dom = $("#theTree").mTree("getSelectedFi");
    $(dom).each(function () {
        $("#theTree").mTree("checkFi", this.id);
    })
}

function testGetFo() {
    theMikeTreeData = $("#theTree").mTree("getFoIds");
    $("#showText").html(theMikeTreeData.join("|"));
}


//获取子结点图标css
function getTheIcon(status, countFlag) {
    if (status === undefined) status = "";
    switch (status) {
        case "True":
            if (countFlag !== undefined) {
                var onlineDom = $("#onLineTerminals");
                $(onlineDom).html(parseInt($(onlineDom).html()) + 1);
            }
            return "icon-status";
            break;
        case "False":
            if (countFlag !== undefined) {
                var offlineDom = $("#offLineTerminals");
                $(offlineDom).html(parseInt($(offlineDom).html()) + 1);
            }
            return "icon-status-offline";
            break;
        case "":
            if (countFlag !== undefined) {
                var notSureDom = $("#notSureTerminals");
                $(notSureDom).html(parseInt($(notSureDom).html()) + 1);
            }
            return "icon-notSure";
            break;
    }
}


